  [],\n\t\"revision_timestamp\": \"2016-02-26T22:01:54.802029\",\n\t\"name\": \"ensemble-approach-to-building-mercer-kernels\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This paper presents a new methodology for
  automatic knowledge driven data mining based on the theory of Mercer Kernels, which
  are highly nonlinear symmetric positive definite mappings from the original image
  space to a very high, possibly infinite dimensional feature space. We describe a
  new method called Mixture Density Mercer Kernels (MDMK) to learn kernel function
  directly from data, rather than using pre-defined kernels. These data adaptive kernels
  can encode prior knowledge in the kernel using a Bayesian formulation, thus allowing
  for physical information to be encoded in the model. Specifically, we demonstrate
  the use of the algorithm in situations with extremely small samples of data. We
  compare the results with existing algorithms on data from the Sloan Digital Sky
  Survey (SDSS) and demonstrate the methodu2019s superior performance against standard
  methods. The results show that the Mixture Density Mercer Kernel described here
  outperforms tree-based classification in distinguishing high-redshift galaxies from
  low redshift galaxies by approximately 16% on test data, bagged trees by approximately
  7%, and bagged trees built on a much larger sample of data by approximately 2%.
  The code for these experiments has been generated with the AutoBayes tool, which
  automatically generates efficient and documented C/C++ code from abstract statistical
  model specifications. The core of the system is a schema library which contains
  templates for learning and knowledge discovery algorithms like different versions
  of EM, or numeric optimization methods like conjugate gradient methods. The template
  instantiation is supported by symbolic algebraic computations, which allows AutoBayes
  to find closed form solutions and, where possible, to integrate them into the code.\",\n\t\"license_title\":
